guesses = [('ALLERGENICITIES', '-Y-YYY-YY--Y--G'), ('UTTERABLENESSES', 'YY-YY--Y-Y----G')]


def wordle(wordlist, guesses):
    r = set()
    positive = {}
    unknown = {}
    for g in guesses:
        for i in range(len(g[0])):
            unknown[g[0][i]] = 0

    for g in guesses:
        for i in range(len(g[0])):
            if g[1][i] == 'G':
                positive[i] = g[0][i]
            if g[1][i] == 'Y':
                unknown[g[0][i]] = max(g[0].count(g[0][i]),unknown[g[0][i]])

    print(positive,unknown)

    for w in wordlist:
        flag = True
        for g in guesses:
            for l in range(len(g[1])):
                if g[1][l] == 'G':
                    if g[0][l] == w[l]:
                        continue
                    else:
                        flag = False
                        # print('G',w,g)
                if g[1][l] == '-':
                    if g[0][l] not in w:
                        continue
                    else:
                        flag = False
                        # print('-',l, w, g)
                if g[1][l] == 'Y':
                    if g[0][l] in w and unknown[g[0][l]] <= w.count(g[0][l]):
                        continue
                    else:
                        flag = False
                        # print('Y',l, w, g)
        if flag:
            r.add(w)
    return r

